INSERT INTO `static_page` (`id`, `type`, `descriptions`) VALUES
(1, 'aboutus', '<section class="main-body">\r\n	<div class="about-wrap">\r\n		<div class="container">\r\n			<div class="about-info">\r\n				<h2>\r\n					What We are</h2>\r\n				<p>\r\n					Tirupatitourismseva.com is a modernized spiritual platform for every GOD lover who want to feel the GOD. We know the feeling when a person able to reach near the GOD by the feeling of love and respect. By our small platform onlinedevam.com, we offer everything which you need to feel the good and get the patience from your depth of heart. Our services are globalized because we know there should not have any boundary between the GOD and the real followers.</p>\r\n			</div>\r\n		</div>\r\n		<div class="about-mission">\r\n			<div class="container">\r\n				<div class="row">\r\n					<div class="col-md-6">\r\n						<h2>\r\n							Our Mission</h2>\r\n						<p>\r\n							Tirupatitourismseva.com has started its journey to offers every type of spiritual goods to the followers of the GOD. This is our small effort to reduce the gap between the Creator of the World and the lovers of GOD. Our modern services are globalized and we are available everywhere where you want to feel the love of GOD. We committed to offering the best spiritual items and services such as Shani Pooja, Rudrabhishek Pooja, branded Rudraksha, Yantra, Gemstones and much more spiritual items. Also, we offer online dev darshan tickets services to make your way easier towards the GOD.</p>\r\n					</div>\r\n					<div class="col-md-6">\r\n						<h2>\r\n							Why are We Here</h2>\r\n						<p>\r\n							Our motivation is not only to offer spiritual items through the world. We are committed to giving you the best services and products. Our spiritual organization knows the feeling of GOD and with the love of GOD, we have started our journey to offer spiritual items to make the ways easier for followers of GOD. Our team&#39;s effort based on the distribution of love with the culture of our India.</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n		<div class="container">\r\n			<div class="about-info">\r\n				<h2>\r\n					Why are We Unique</h2>\r\n				<p>\r\n					Our spiritual organization Tirupatitourismseva.com offers some unique services for those persons who love to feel the love of GOD. Our services are boundaryless, also, we are ready to offer you those services which can give you patience from the depth of heart such as</p>\r\n				<div class="about-list">\r\n					<ul>\r\n						<li>\r\n							We offer more than 30 temples prasad, home delivery worldwide.</li>\r\n						<li>\r\n							Highly branded spiritual goods like Shani Pooja, Rudrabhishek Pooja, branded Rudraksha, Yantra, Gemstones and much more.</li>\r\n						<li>\r\n							Puja services</li>\r\n						<li>\r\n							Spiritual tours and mandir darshan tickets.</li>\r\n					</ul>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</section>\r\n<p>\r\n	&nbsp;</p>\r\n'),
