or responsible to timely see, process, act on or respond to any message sent by you using Electronic Messages.</p>\r\n		</div>\r\n		<div class="information-wrap">\r\n			<h4>\r\n				Use of E-mail and other Electronic Messages</h4>\r\n			<p>\r\n				1. You acknowledge and confirm that you have full knowledge and information that any electronic mail, chat, information, submission or instant messenger communication, whether transmitted through the Internet, the Website, a proprietary network, a computer, a pager or other wireless device or otherwise (collectively, &quot;Electronic Messages&quot;) may not be secure and communications using Electronic Messages may not be confidential.</p>\r\n			<p>\r\n				2. Tirupatitourismseva.com shall be neither liable nor responsible to update any information communicated to you using Electronic Messages nor shall Tirupatitourismseva.com or its representatives be liable or responsible to timely see, process, act on or respond to any message sent by you using Electronic Messages.</p>\r\n		</div>\r\n		<div class="information-wrap">\r\n			<h4>\r\n				Prices and products</h4>\r\n			<p>\r\n				1. Tirupatitourismseva.com reserves the right to change the pricing and specifications from time to time.</p>\r\n			<p>\r\n				2. Tirupatitourismseva.com shall is no event or circumstances be held liable and/or responsible for any discrepancy or inaccuracy in reporting the prices and product specifications (including the product description, photos, vegetarian, Jain, weight/size) nor shall it be liable for any costs, actions, claims or demands that may arise or accrue in respect of the same.</p>\r\n			<p>\r\n				3. Tirupatitourismseva.com shall not be liable or responsible for any products, information or services mentioned on the Website, whether provided by Tirupatitourismseva.com, or any third parties. You agree to make your own independent evaluation of the products, information and services mentioned on the Website, including their quality.</p>\r