(3, 'policy', '<section class="main-body">\r\n	<div class="container">\r\n		<div class="information-wrap">\r\n			<h4>\r\n				Privacy Policies</h4>\r\n			<p>\r\n				1. All tickets should be purchased by online transaction only by using Credit cards/Debit Cards/Internet Banking or any other online services.</p>\r\n			<p>\r\n				2. No off line payment will be accepted.</p>\r\n			<p>\r\n				3. Users have to understand that, we never store any online transaction credentials for future use.</p>\r\n			<p>\r\n				4. All payment systems are secured by third party payment gateway so Devam Spiritual Services is not responsible for any missuses of your credentials.</p>\r\n		</div>\r\n		<div class="information-wrap">\r\n			<h4>\r\n				Refund Policies</h4>\r\n			<p>\r\n				1. No refund will be allowed after generating the darshan ticket.</p>\r\n			<p>\r\n				2. Users has to inform about ticket cancelation before generating the darshan ticket by email or phone call</p>\r\n			<p>\r\n				3. Only the price of the ticket will be refundable, service charges and any other related charges are non-refundable.</p>\r\n			<p>\r\n				4. All purchased amount will be refunded if any mistakes will arrive by Devam Spiritual Services like Name, Address.</p>\r\n		</div>\r\n	</div>\r\n</section>\r\n'),
(4, 'contact', '<section class="main-body">\r\n	<div class="container">\r\n		<div class="contact-row row">\r\n			<div class="col-md-6">\r\n				<div class="contact-wrap">\r\n					<span class="contact-heading">Devam Spiritual Services</span>\r\n					<p>\r\n						It is a great pleasure for Online Devam team to help you at any time. Our dedicated team is committed to offering you every type of support. Contact us for any type of payment related inquiry or any type of product related inquiry.<br />\r\n						Drop us an E-mail on bellow mentioned mail id and our dedicated team member will revert you within 24 Hours.</p>\r\n				</div>\r\n			</div>\r\n			<div class="col-md-6">\r\n				<div class="contact-right">\r\n					<div class="contact-info">\r\n						&nbsp;</div>\r\n					<div class="contact-info">\r\n						<span class="contact-heading">Email</span> <span class="contct-email"><a href="#">info@tirupatitourismseva.com</a>,&nbsp;</span>&nbsp;tirupatitourismseva@gmail.com&nbsp;</div>\r\n					<div class="clearfix">\r\n						&nbsp;</div>\r\n				</div>\r\n				<div class="clearfix">\r\n					&nbsp;</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</section>\r\n<p>\r\n	&nbsp;</p>\r\n');
